r\u003e        List.append(s[i])\u003cbr\u003e    for i in range(len(s)):\u003cbr\u003e        Reversed_list.append(List[len(s) - i - 1])\u003cbr\u003e    result = ''.join(['\"']+Reversed_list+['\"'])\u003cbr\u003e    return result\u003cbr\u003e        ","analysis.embedding.code_embedding"],["def reverse_string(s):\u003cbr\u003e    return s[::-1]","analysis.embedding.code_embedding"],["def reverse_string(s):\u003cbr\u003e    a=str()\u003cbr\u003e    for i in range(1,len(s)+1):\u003cbr\u003e        a=a+s[-i]\u003cbr\u003e\u003cbr\u003e    return a","analysis.embedding.code_embedding"],["a = input(\"Enter string : \")\u003cbr\u003e\u003cbr\u003edef reverse_string(s):\u003cbr\u003e    return s[::-1]\u003cbr\u003e\u003cbr\u003eprint(reverse_string(a))","analysis.embedding.code_embedding"],["def reverse_string(s):\u003cbr\u003e\u003cbr\u003e    return s[::-1]  # The first component is by default '0' and the 2nd component is by default end of the string\u003cbr\u003e\u003cbr\u003eprint(reverse_string('hello'))\u003cbr\u003eprint(reverse_string('Python'))\u003cbr\u003eprint(reverse_string(''))","analysis.embedding.code_embedding"],["def reverse_string(s):\u003cbr\u003e    l = list(s)\u003cbr\u003e    s1 = \"\"\u003cbr\u003e    for i in range (len(l)):\u003cbr\u003e        s1 += l[len(l)-i-1]\u003cbr\u003e    return s1\u003cbr\u003eprint(reverse_string(\"hello\"))","analysis.embedding.code_embedding"],["def reverse_string(s):\u003cbr\u003e    return s[::-1]","analysis.embedding.code_embedding"],["def reverse_string(s):\u003cbr\u003e    if len(s)==1:\u003cbr\u003e        return s\u003cbr\u003e    else:\u003cbr\u003e        return s[len(s)-1]+reverse_string(s[:len(s)-1])\u003cbr\u003eprint(reverse_string('hello'))\u003cbr\u003eprint(reverse_string('Python'))\u003cbr\u003eprint(reverse_string(' '))","analysis.embedding.code_embedding"],["def reverse_string(s):\u003cbr\u003e    return s[::-1]\u003cbr\u003e\u003cbr\u003eprint(reverse_string(\"hello\"))\u003cbr\u003e        ","an   let searchTraceIndex = null;

  function updateSearch(query) {
    // remove prior search trace
    if (searchTraceIndex !== null && gd.data && gd.data[searchTraceIndex]) {
      Plotly.deleteTraces(gd, searchTraceIndex);
      searchTraceIndex = null;
    }
    query = (query || "").toLowerCase().trim();
    if (!query) return;
    const hits = [];
    for (let i=0; i<ids.length; i++) {
      if ((ids[i] || "").toLowerCase().includes(query)) {
        hits.push(i);
      }
    }
    if (!hits.length) return;
    const trace = {
      x: hits.map(i => xs[i]),
      y: hits.map(i => ys[i]),
      mode: 'markers+text',
      text: hits.map(i => ids[i]),
      textposition: 'top center',
      marker: {
        symbol: 'star',
        size: 20,
        color: 'rgba(0,0,0,0)',
        line: { color: 'red', width: 3 }
      },
      name: 'Search',
      hoverinfo: 'skip'
    };
    Plotly.addTraces(gd, [trace]).then(idxs => {
      searchTraceIndex = idxs[0];
    });
  }

  function initControls() {
    const input = document.getElementById('searchBox');
    const btn = document.getElementById('searchBtn');
    if (!input || !btn) return;

    // Click button triggers search
    btn.addEventListener('click', () => updateSearch(input.value));

    // Pressing Enter in input triggers search
    input.addEventListener('keydown', (e) => {
      if (e.key === 'Enter') {
        e.preventDefault();
        btn.click();
      }
    });
  }

  if (gd) {
    if (gd._fullLayout) {
      initControls();
    } else {
      gd.addEventListener('plotly_afterplot', initControls, { once: true });
